svg.script:

function init(evt) {
    var bg = document.getElementById('svg');
    var vb = bg.getAttribute('viewBox');
    vb = vb.split(" ");
    var nvb = new Array(4);
    nvb[2] = Math.random()*vb[2];
    nvb[3] = Math.random()*vb[3];
    nvb[0] = Math.random()*nvb[2];
    nvb[1] = Math.random()*nvb[3];
    nvb = nvb.join(" ");
    bg.setAttribute('viewBox', nvb);
};
